column4:
A physical constant featured in many fundamental equations in the physical sciences. It is equivalent to the Boltzmann constant, but expressed in units of energy per temperature increment per mole (rather than energy per temperature increment per particle). It has the value 8.314 J.K-1.mol-1 and is denoted by the symbol R.|modified from wikipedia: http://en.wikipedia.org/wiki/Gas_constant;
see also: OPB_00410 (Ontology of Physics in Biology);
created in response: [SF req #3293425]

