column4:
A measure of enzyme activity under standard conditions, at a specific substrate concentration (usually saturation), expressed as the amount of product formed per unit time, per amount of enzyme. This is often expressed as micromol per min per mg, rather than the less practical official unit, Katal (1 mol per second).|refer to [SF req #3301506];
see also: http://en.wikipedia.org/wiki/Enzyme_assay#Specific_activity;
request by Oliver Ruebenacker

